import React from 'react';

class InputField extends React.Component{
    constructor(props){
        super(props);
    }

    checkExistList = () => {
        try {
          this.setState({
            machineExistStatus: "",
            responseMessage: "",
            buttonStatus: {
              visibility: "visible"
            }
          });
          const showList = (item, index) => {
            if (
              this.state.machineName.toLowerCase() === item.name.toLowerCase()
            ) {
              this.setState({
                machineExistStatus: "* This machine name is already exist!!!",
                buttonStatus: {
                  visibility: "hidden"
                }
              });
            } else {
            }
          };
          this.state.machineList.forEach(showList);
        } catch (err) {}
        console.log(this.state.machineName);

      };

    render(){
        return(
            <div>
                <input 
                    type= {this.props.type}
                    placeholder= {this.props.placeholder}
                    className= {this.props.className}
                    autoComplete= {this.props.autoComplete}
                    minLength= {this.props.minLength}
                    maxLength= {this.props.maxLength}
                    onChange= { e => {
                        this.props.callBackFunction(e.target.value)
                    }}
                />
            </div>
        );
    }
}

export default InputField;
